import React from 'react';
import './DigitalClock.scss'

const DigitalClock = ({props}) => {
  let {hours, minutes, seconds} = this.props;

  return (
    <div className={"digital-clock"}>
      {hours}:{minutes}:{seconds}
    </div>
  )
}

export default DigitalClock
